リーズナブルなローコストモデル<br>130万画素 HD録画対応！<br>自動録画/手動録画に対応！<br>3ステップですぐに使える！<br>microSDHCカード8GB（CLASS10）同梱<br>保証期間：メーカー1年保証<br><br><table id="media-table"><tr><th colspan="2">仕様</th></tr><tr><th>撮像素子</th><td>130万画素 CMOSセンサー</td></tr><tr><th>対応記憶媒体</th><td>microSDHCメモリーカード<br>32GBまで Class10以上推奨</td></tr><tr><th>保存形式</th><td>動画：MJPEG(AVI)(音声:PCM)<br>画像：JPEG</td></tr><tr><th>動画サイズ</th><td>1280×720(30fps) ※初期設定値<br>640×480(30fps) </td></tr><tr><th>静止画サイズ</th><td>1920×1440(2.7M)(画素補完) ※初期設定値<br>1600×1200(2M)(画素補完)<br>1280×960(1.3M)<br>640×480(VGA)</td></tr><tr><th>モニター</th><td>2.4インチ液晶</td></tr><tr><th>ズーム</th><td>なし</td></tr><tr><th>レンズ視野角</th><td>120°</td></tr><tr><th>露出</th><td>±2.0</td></tr><tr><th>モード</th><td>動画/静止画/音声/再生</td></tr><tr><th>Gセンサー</th><td>なし</td></tr><tr><th>暗所撮影機能</th><td>白色LEDライト</td></tr><tr><th>マイク/スピーカー</th><td>マイク内蔵/スピーカー非搭載</td></tr><tr><th>音声録音</th><td>オン/オフ可能　※初期設定時オン</td></tr><tr><th>ループ録画時間</th><td>1分単位<br>3分単位<br>5分単位 ※初期設定値<br>10分単位</td></tr><tr><th>操作音</th><td>あり</td></tr><tr><th>その他機能</th><td>動態検知 ※初期設定時オフ</td></tr><tr><th>端子/スロット</th><td>USBminiB端子、microSDカード</td></tr><tr><th>電源</th><td>リチウムイオン充電池（内蔵）<br>シガーソケット電源アダプター（対応車種:12V車）</td></tr><tr><th>外形寸法</th><td>W91×H54×D26mm</td></tr><tr><th>重量</th><td>約55g</td></tr><tr><th>動作温度範囲</th><td>0℃～40℃</td></tr><tr><th>動作湿度範囲</th><td>20％～80％(結露なきこと)</td></tr><tr><th>同梱内容</th><td>本体<br>シガーアダプタ<br>専用スタンド<br>USBケーブル<br>配線用シール付フック<br>取扱説明書<br>microSDHCカード 8GB CLASS10</td></tr><tr><th>保証期間</th><td>１年間</td></tr></table><p class="media-title">その他のモデルはコチラ！</p><ul id="media-set" class="clearfix"><li class="clearfix">ハイエンドモデル P-FHD27<br>300万画素/フルHD/視野角170°</li><li class="clearfix">スタンダードモデル P-H27<br>200万画素/HD/視野角140°</li></ul><br><br><p class="red"><b>【ご注意下さい】</b><br>楽天システムの都合上、プルダウンメニューからお選び頂いた追加商品代金は自動計算がされません。<br>自動配信メールとは別に、正しく修正した合計金額をメールにてお知らせ致しますので、ご了承ください。</p><style type="text/css">
