●使用方法<br>
&#9312;ロールアップするときは、窓を一番下まで下げた状態で、フックを車両の外側に倒します。<br>
&#9313;窓を上げるとフックが窓にひっかかり、窓と連動して上げ下げができるようになります。<br>
&#9314;ロールダウンするときは、窓を一番下まで下げるとフックが外れます。<br>
&#9315;窓を上げるとフックが外れているので、窓ガラスだけを上げ下げできるようになります。<style type="text/css">
